const Login = () => {

const handleChange = () =>{};
const handleSubmit = () =>{};

const signinForm = () =>
<form className onSubmit={handleSubmit}>
<div className="form-group">
    <label className="label1" for="">E-mail</label>
    <input type="email" onChange={handleChange('email')} value={email1} className="input form-control" placeholder="Type Your Email" />
</div>
<div className="form-group">
    <label className="label1" for="">Password</label>
    <input type="password" onChange={handleChange('password')} className="input form-control" placeholder="Type Your Password" />
</div>
</form>

return(
     <Layout>
<div className="container">
    <div className="row">
    <div className="col-md-5 register-left">
            <img src={"/images/r1.jpg"} alt="imageHere" />
            <h3>Log in for more fun!</h3>
            <h1>Academic Earth</h1>
            <p>E-learning Platform</p>
            <button type="button" class="btn btn-primary">About</button>
            </div>
        <div className="full col-md-7 register-right">
            <h1>Login Here</h1>
            <br />
            {signinForm()}
            <br />
            {/* {JSON.stringify(state)} */}
        </div>
        </div>
        </div>
    </Layout>
);
};

export default Login;
